import Logo from "./Logo";
import React from "react";

const Login = () => {
  return (
    <div className="login container">
      <div className="login-content ">
        <div className="login-split-content">
        <Logo />
        <h1 style={{fontWeight:'1000'}}>Log in</h1>
        <input type="text" placeholder="Email address" className="form-control mt-2"/>
        <input type="password" placeholder="Password" className="form-control  mt-2"/>
        <button type="submit" className="submit">Log in</button>
        <button type="submit" className="email form-control">Email me a login link</button>
        <button type="submit" className="google form-control"><div className="img"></div>Sign in with Google</button>
        </div>
        
      </div>
      <div className="login-image"></div>
    </div>
  );
};

export default Login;
